INSERT INTO `noticias` VALUES ('2022-03-10',' Google Revela Energia Berriztagarrian Aurrerapenak Datu Zentroetarako ',' Googlek bere datu zentroak energia berriztagarriarekin elikatzeko soluzio berritzaile bat iragarri zuen, abangoardiako eguzki teknologia eta haize-teknologia erabiliz. ','https://play-lh.googleusercontent.com/6UgEjh8Xuts4nwdWzTnWH8QtLuHqRMUB7dp24JYVE2xcYzq4HA8hFfcAbU-R-PC_9uA1'),('2022-05-22','Apple-ek Errealitate Areagotuko Entzungailu Berrien Merkaturatzea iragartzen du',' Applek mundu teknologikoa harritu zuen errealitate areagotuko lehen entzungailuen iragarpenarekin, aurrekaririk gabeko esperientzia murgiltzailea promes eginez. ','data:image/png;base64,'),('2022-08-08',' Tesla bere Ekoizpen Masiboko Lehen Ibilgailu Autonomoa','Elon Musk-ek Model A aurkeztu zuen, Teslaren lehen automobil erabat autonomoa, mugarri garrantzitsu bat ezarri zuena bere buruari eragiten dion industrian. ','https://m.media-amazon.com/images/I/41-WtwMCz6S.jpg'),('2022-09-20',' Microsoft Surface Belaunaldi Berria Pantaila Tolesgarriekin ',' Microsoftek berriz diseinatutako Surface gailuen linea bat iragarri zuen, pantaila tolesgarriak eta funtzio multitaktil hobetuak dituzten tabletak eta eramangarriak barne. ','https://cms.rootstack.com/sites/default/files/inline-images/microsoft.png'),('2022-11-03',' Amazon-ek bere Laguntzaile Birtuala aurkezten du, Denbora Errealeko Itzulpengintzarako Gaitasunekin','Amazon Echo orain denbora errealeko itzulpen-funtzioa du, erabiltzaileei hizkuntza askotan erraz komunikatzeko aukera ematen diena. ','https://static.vecteezy.com/system/resources/previews/019/136/322/non_2x/amazon-logo-amazon-icon-free-free-vector.jpg'),('2022-11-15',' Facebook Iragarri Pribatutasun Neurri Berriak Erabiltzailearen Informazioa Babesteko ',' Pribatutasun kezkei erantzunez, Facebookek politika eta tresna berriak ezarriko ditu erabiltzaileen informazio pertsonala babesteko. ','https://www.facebook.com/images/fb_icon_325x325.png');
